import {Card} from "../component/Component";

const data = [
  { bgColor: "green-300", text: "white", icon:"bi bi-person-fill", title: "Data kunjungan", description: "600" },
  { bgColor: "blue-500", text: "white", icon:"bi bi-capsule-fill", title: "Data Siswa", description: "1200" },
];

function Home(){
    return (
        <div className="w-full h-screen">
            <div className={`grid grid-cols-2 lg:grid-cols-4 sm:grid-cols-3 justify-items-center gap-4`}>
                {data.map((item, idx) => (
                    <Card
                    key={idx}
                    bgColor={item.bgColor}
                    text={item.text}

                    title={item.title}
                    description={item.description}
                    />
                ))}
            </div>
        </div>
    );
}
export default Home;
